module Day5Spec where

import Test.Hspec
import Day5

specs :: SpecWith ()
specs = describe "Day 5" $ do
  describe "Part 1 - stream reduction" $ do
    it "works for sample inputs" $ do
      streamReduce "aA" `shouldBe` 0
      streamReduce "abBA" `shouldBe` 0
      streamReduce "abAB" `shouldBe` 4
      streamReduce "aabAAB" `shouldBe` 6
    it "works for example input" $ do
      streamReduce exampleInput `shouldBe` 10
    it "works for puzzle input" $ do
      streamReduce puzzleInput `shouldBe` 11298

  describe "Part 2 - max reduction" $ do
    it "works for example input" $ do
      streamMaxReduce exampleInput `shouldBe` 4
    it "works for puzzle input" $ do
      streamMaxReduce puzzleInput `shouldBe` 5148


exampleInput :: String
exampleInput = "dabAcCaCBAcCcaDA"

puzzleInput :: String
puzzleInput = ""
